import { configureStore } from "reduxjs";
import { carsReducer,addCar , removeCar,changeTerm } from "./Slices/carsSlices";
import { formReducer,changeCost,changeName } from "./Slices/formSlices";

const store=configureStore({
    reducer:{
        cars:carsReducer,
        form:formReducer,

    }
})



export {
    store,
    changeCost,
    changeName,
    addCar,
    removeCar,
    changeTerm
}
